function imprimirTablaAli() {
    let contenido = "";
    let renglon = "";
    for (let j = 0; j < listaAli.alimentos.length; j++) {
        renglon = "";
        renglon += "<tr>";
        renglon += "<td>" + listaAli.alimentos[j].id + "</td>";
        renglon += "<td>" + listaAli.alimentos[j].nombre + "</td>";
        renglon += "<td>" + listaAli.alimentos[j].descripcion + "</td>";
        renglon += "<td>" + listaAli.alimentos[j].categoria + "</td>";
        renglon += "<td>" + listaAli.alimentos[j].precio + "</td>";
        renglon += "<td>" + listaAli.alimentos[j].estatus + "</td>";
        renglon += "<td> <img src= " + listaAli.alimentos[j].foto + " alt='alt' height='100' width='100'></td>";

        renglon += "<td><button type='button' onClick='modificarAli(" + j + ");' class='btn btn-lg'>\n\
        <i class='fa-solid fa-arrows-spin fa-2xl' style='color: #FAAF08'></i></button></td>";
        renglon += "<td><button type='button' onClick='eliminarAli(" + j + ");' class='btn btn-lg'>\n\
        <i class='fa-solid fa-circle-xmark fa-2xl' style='color: #FAAF08'></i></button></td>";
        renglon += "</tr>";

        contenido += renglon;
    }

    document.getElementById("tbCatAli").innerHTML = contenido;
}

function modificarAli(j) {
    document.getElementById("txtIdAli").value = listaAli.alimentos[j].id;
    document.getElementById("txtNomAli").value = listaAli.alimentos[j].nombre;
    document.getElementById("txtDesAli").value = listaAli.alimentos[j].descripcion;
    document.getElementById("txtCatAli").value = listaAli.alimentos[j].categoria;
    document.getElementById("txtPreAli").value = listaAli.alimentos[j].precio;
    document.getElementById("txtEstAli").value = listaAli.alimentos[j].estatus;
    document.getElementById("txtFotoAli").value = listaAli.alimentos[j].foto;
    o = j;
    return o;
}


function modAli(o) {
    listaAli.alimentos[o].id = document.getElementById("txtIdAli").value;
    listaAli.alimentos[o].nombre = document.getElementById("txtNomAli").value;
    listaAli.alimentos[o].descripcion = document.getElementById("txtDesAli").value;
    listaAli.alimentos[o].categoria = document.getElementById("txtCatAli").value;
    listaAli.alimentos[o].precio = document.getElementById("txtPreAli").value;
    listaAli.alimentos[o].estatus = document.getElementById("txtEstAli").value;
    listaAli.alimentos[o].foto = document.getElementById("txtFotoAli").value;

    let alimento = {
        "id": listaAli.alimentos[o].id,
        "nombre": listaAli.alimentos[o].nombre,
        "descripcion": listaAli.alimentos[o].descripcion,
        "categoria": listaAli.alimentos[o].categoria,
        "precio": listaAli.alimentos[o].precio,
        "estatus": listaAli.alimentos[o].estatus,
        "foto": listaAli.alimentos[o].foto
    };

    listaAli.alimentos[o] = alimento;

    Swal.fire({
        title: "Modificación correcta",
        text: "El alimento ha sido modificado correctamente",
        icon: "success"
    });

    cancelarAli(); // Assuming this function cancels the modification operation

    imprimirTablaAli(); // Assuming this function prints the updated table of alimentos
}


function cancelarAli() {
    document.getElementById("txtIdAli").value = "";
    document.getElementById("txtNomAli").value = "";
    document.getElementById("txtDesAli").value = "";
    document.getElementById("txtCatAli").value = "";
    document.getElementById("txtPreAli").value = "";
    document.getElementById("txtEstAli").value = "";
    document.getElementById("txtFotoAli").value = "";
}

function agregarAli() {
    let ultimoId = listaAli.alimentos[listaAli.alimentos.length - 1].id;
    let id = ultimoId + 1;
    let nom = document.getElementById("txtNomAli").value;
    let descripcion = document.getElementById("txtDesAli").value;
    let categoria = document.getElementById("txtCatAli").value;
    let precio = document.getElementById("txtPreAli").value;
    let estatus = document.getElementById("txtEstAli").value;
    let foto = document.getElementById("txtFotoAli").value;


    let alimento = {"id": id, "nombre": nom, "descripcion": descripcion,
        "categoria": categoria, "precio": precio, "estatus": estatus, "foto": foto};

    listaAli.alimentos.push(alimento);

    Swal.fire({
        title: "Inserción correcta",
        text: "El alimento ha sido insertado correctamente",
        icon: "success"
    });

    cancelarAli();

    imprimirTablaAli();
}

function eliminarAli(j) {

    Swal.fire({
        title: "¿Realmente quieres eliminar este alimento?",
        showDenyButton: true,
        showCancelButton: true,
        confirmButtonText: "Si",
        denyButtonText: `No`
    }).then((result) => {
        /* Read more about isConfirmed, isDenied below */
        if (result.isConfirmed) {
            listaAli.alimentos.splice(j, 1);
            Swal.fire({
                title: "Eliminación correcta",
                text: "El alimento ha sido eliminado correctamente",
                icon: "success"
            });
            imprimirTablaAli();

        } else if (result.isDenied) {
            Swal.fire({
                title: "Eliminación incorrecta",
                text: "El alimento no pudo ser eliminado",
                icon: "error"
            });
        }
    });

}

function buscarAli() {
    let buscar = document.getElementById("txtBusqAli").value;
    let posEncontrado = -1;

    for (let j = 0; j < listaAli.alimentos.length; j++) {
        if (listaAli.alimentos[j].id == buscar ||
                listaAli.alimentos[j].nombre == buscar ||
                listaAli.alimentos[j].descripcion == buscar ||
                listaAli.alimentos[j].categoria == buscar ||
                listaAli.alimentos[j].precio == buscar ||
                listaAli.alimentos[j].estatus == buscar ||
                listaAli.alimentos[j].foto == buscar) {
            posEncontrado = j;
            break;
        }
    }

    let textoTabla = "";
    if (posEncontrado == -1) {
        textoTabla = "<tr><td colspan='9'>No se encontraron resultados de búsqueda</td></tr>";
    } else {
        let alimento = listaAli.alimentos[posEncontrado];
        textoTabla += "<tr>";
        textoTabla += "<td>" + alimento.id + "</td>";
        textoTabla += "<td>" + alimento.nombre + "</td>";
        textoTabla += "<td>" + alimento.descripcion + "</td>";
        textoTabla += "<td>" + alimento.categoria + "</td>";
        textoTabla += "<td>" + alimento.precio + "</td>";
        textoTabla += "<td>" + alimento.estatus + "</td>";
        textoTabla += "<td> <img src='" + alimento.foto + "' alt='alt' height='100' width='100'></td>";
        textoTabla += "<td><button type='button' onClick='modificarBeb(" + posEncontrado + ");' class='btn btn-lg'>\n\
        <i class='fa-solid fa-arrows-spin fa-2xl' style='color: #FAAF08'></i></button></td>";
        textoTabla += "<td><button type='button' onClick='eliminarBeb(" + posEncontrado + ");' class='btn btn-lg'>\n\
        <i class='fa-solid fa-circle-xmark fa-2xl' style='color: #FAAF08'></i></button></td>";
        textoTabla += "</tr>";
    }
    document.getElementById("tbCatAli").innerHTML = textoTabla;
}


function cargarImgAli() {
    let inputFile = document.getElementById("ifFotoAli");
    if (inputFile.files && inputFile.files[0]) {
        let reader = new FileReader();
        reader.onload = function (e) {
            let foto = e.target.result;
            document.getElementById("fotoAli").src = foto;
            document.getElementById("txtFotoAli").value = foto;
        };
        reader.readAsDataURL(inputFile.files[0]);

    }
}